  \"anchorage-areas\",\n\t\"isopen\": false,\n\t\"url\": null,\n\t\"notes\": \"An
  anchorage area is a place where boats and ships can safely drop anchor. These areas
  are created in navigable waterways when ships and vessels require them for safe
  and responsible navigation. A variety of designations refer to types of anchorage
  areas or restrictions, or even to alerts of potential dangers within an anchorage
  area. Every boater and captain should be aware of the various types of anchorage
  areas. These data are intended for coastal and ocean planning. Not for navigation.\",\n\t\"license_title\":
